syntax = "proto3";
package fanxi;
import "BaseResponse.proto";
option java_package = "com.fanxi.service.message";
option java_outer_classname = "RTEndRouletteResponseProto";

message RTEndRouletteResponse {
   BaseResponse baseResponse=1;
   int64 reference=4;
   bool isGold=5;
   int32 result=6;
   int64 wonMoney=7;
   int64 cash=8;
}




